import React from "react";
import { works } from "../datas/Works";

const HomeWork = ({ name, category, id, description, url, cover }) => {
  return (
    <>
      {works.map(({ id, name, category }) => (
        <div key={id}>
          <h3>{name}</h3>
          <p>{id}</p>
          <p>{category}</p>

          <HomeWork name={name} id={id} category={category} />
        </div>
      ))}
    </>
  );
};

export default HomeWork;
